import Layout from "../components/Layout";

import { Grid, Typography } from "@material-ui/core";

const About = () => (
  <Layout>
    <Grid container>
      <Grid item lg={2}></Grid>

      <Grid
        item
        lg={8}
        style={{ marginTop: 60, backgroundColor: "#eee", height: "100%" }}
      >
        <Typography variant="h2">About Tomato</Typography>
      </Grid>

      <Grid item lg={2}></Grid>
    </Grid>
  </Layout>
);

export default About;
